import React from 'react';
import PostNewFeed from './../Components/NewFeed/PostNewFeed.jsx';

function PostNewFeedContainer(props){
  return(
    <PostNewFeed key={props.key} post={props.post}/>
  )
}

export default PostNewFeedContainer;
